# https://leetcode.com/problems/find-all-anagrams-in-a-string/
# Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.
# Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.
# The order of output does not matter.
# Example 1:
# Input:
# s: "cbaebabacd" p: "abc"
# Output:
# [0, 6]
# Explanation:
# The substring with start index = 0 is "cba", which is an anagram of "abc".
# The substring with start index = 6 is "bac", which is an anagram of "abc".
# Example 2:
# Input:
# s: "abab" p: "ab"
# Output:
# [0, 1, 2]
# Explanation:
# The substring with start index = 0 is "ab", which is an anagram of "ab".
# The substring with start index = 1 is "ba", which is an anagram of "ab".
# The substring with start index = 2 is "ab", which is an anagram of "ab".

def findAnagrams(s, p):

	ls = len(s)
	lp = len(p)
	
	p_dict = dict()
	for i in range(lp):
		if p[i] not in p_dict.keys():
			p_dict[p[i]] = 1
		else:
			p_dict[p[i]] += 1
			
	
	found = 0
	op = []
	for idx,ch in enumerate(s):
		print("Entering",ch,found,p_dict) if debug else None
		if idx >= lp:
			#print("Here")
			if s[idx-lp] in p_dict.keys():
				p_dict[s[idx-lp]] += 1
				if p_dict[s[idx-lp]] >= 1:
					found -= 1
				#print("Here",idx,s[idx-lp],p_dict[s[idx-lp]])
				#print(p_dict)
			print("After fixing Dict and Found",ch,found,p_dict) if debug else None
		if ch in p_dict.keys():
			p_dict[ch] -= 1
			if p_dict[ch] >= 0:
				found += 1
				print("Found Increased",ch,found,p_dict) if debug else None
			if found == lp:
				op.append(idx-lp+1)
				print("Found first result",idx,ch,found,p_dict) if debug else None
				#found -= 1
		print("Ending:",ch,found,p_dict) if debug else None
	print(op) if debug else None
	return(op)

debug = True
debug = False
print(findAnagrams('baa','aa'))
print(findAnagrams('abaacbabc','abc'))
print(findAnagrams('cbaebabacd','abc'))
print(findAnagrams('abca','abc'))
print(findAnagrams('aabaa','aa'))
print(findAnagrams("",""))
